(13, 'Nueva construcci√≥n.', 'Muy lejos, m√°s all√° de las monta√±as de palabras, alejados de los pa√≠ses de las vocales y las consonantes, viven los textos simulados. Viven aislados en casas de letras, en la costa de la sem√°ntica, un gran oc√©ano de lenguas.<br>Un riachuelo llamado Pons fluye por su pueblo y los abastece con las normas necesarias. Hablamos de un pa√≠s paraisom√°tico en el que a uno le caen pedazos de frases asadas en la boca.<br>Ni siquiera los todopoderosos signos de puntuaci√≥n dominan a los textos simulados; una vida, se puede decir, poco ortogr√°fica.<br>Pero un buen d√≠a, una peque√±a l√≠nea de texto simulado, llamada Lorem Ipsum, decidi√≥ aventurarse y salir al vasto mundo de la gram√°tica. El gran Oxmox le desanconsej√≥ hacerlo, ya que esas tierras estaban llenas de comas malvadas, signos de interrogaci√≥n salvajes y puntos y coma traicioneros, pero el texto simulado no se dej√≥ atemorizar. Empac√≥ sus siete versales.', '2015-07-21 10:46:07', 'data:image/jpeg;base64,', 'uspr0017', 'Noticia');
