(15, 'Nuevo horario universitario', 'Reina en mi esp√≠ritu una alegr√≠a admirable, muy parecida a las dulces alboradas de la primavera, de que gozo aqu√≠ con delicia.<br>Estoy solo, y me felicito de vivir en este pa√≠s, el m√°s a prop√≥sito para almas como la m√≠a, soy tan dichoso, mi querido amigo, me sojuzga de tal modo la idea de reposar, que no me ocupo de mi arte.<br>Ahora no sabr√≠a dibujar, ni siquiera hacer una l√≠nea con el l√°piz; y, sin embargo, jam√°s he sido mejor pintor Cuando el valle se vela en torno m√≠o con un encaje de vapores; cuando el sol de mediod√≠a centellea sobre la impenetrable sombra de mi bosque sin conseguir otra cosa que filtrar entre las hojas algunos rayos que penetran hasta el fondo del santuario, cuando recostado sobre la crecida hierba, cerca de la cascada, mi vista, m√°s pr√≥xima a la tierra, descubre multitud de menudas y diversas plantas; cuando siento m√°s cerca de mi coraz√≥n los rumores de vida de ese peque√±a.', '2015-07-21 10:50:26', 'data:image/jpeg;base64,', 'admin', 'Noticia');
